<script setup>
import { ref, computed, watch, onMounted } from 'vue'
import { gsap } from 'gsap'

const props = defineProps({
  multiplier: {
    type: Number,
    default: 1.0,
  },
  gameState: {
    type: String,
    default: 'idle',
  },
})

const alien = ref(null)
const alienWrapper = ref(null)

const displayMultiplier = computed(() => {
  return props.multiplier.toFixed(2) + 'X'
})

// Анимация при старте игры
watch(
  () => props.gameState,
  (newState, oldState) => {
    if (newState === 'flying' && oldState === 'idle') {
      animateFlight()
    } else if (newState === 'crashed') {
      animateCrash()
    } else if (newState === 'idle') {
      resetAnimation()
    }
  },
)

function animateFlight() {
  // Пульсация пришельца
  gsap.to(alien.value, {
    scale: 1.1,
    duration: 0.5,
    yoyo: true,
    repeat: -1,
    ease: 'power1.inOut',
  })

  // Вращение лучей
  gsap.to('.ray', {
    rotation: 360,
    duration: 3,
    repeat: -1,
    ease: 'linear',
    stagger: 0.1,
  })
}

function animateCrash() {
  // Остановка всех анимаций
  gsap.killTweensOf(alien.value)
  gsap.killTweensOf('.ray')

  // Эффект взрыва
  gsap
    .timeline()
    .to(alien.value, {
      scale: 1.3,
      duration: 0.1,
      ease: 'power2.out',
    })
    .to(alien.value, {
      scale: 0,
      opacity: 0,
      duration: 0.3,
      ease: 'power2.in',
    })
    .to(
      '.ray',
      {
        scale: 2,
        opacity: 0,
        duration: 0.3,
        ease: 'power2.out',
      },
      '<',
    )
}

function resetAnimation() {
  gsap.killTweensOf(alien.value)
  gsap.killTweensOf('.ray')

  gsap.to(alien.value, {
    scale: 1,
    opacity: 1,
    duration: 0.3,
  })

  gsap.to('.ray', {
    scale: 1,
    opacity: 1,
    rotation: 0,
    duration: 0.3,
  })
}

onMounted(() => {
  // Начальная idle анимация (легкое покачивание)
  gsap.to(alien.value, {
    y: -5,
    duration: 2,
    yoyo: true,
    repeat: -1,
    ease: 'sine.inOut',
  })
})
</script>

<template>
  <div class="alien-container">
    <!-- Пришелец с неоновыми лучами -->
    <div class="alien-wrapper" ref="alienWrapper">
      <!-- Неоновые лучи (4 штуки) -->
      <div class="neon-rays">
        <div class="ray ray-1"></div>
        <div class="ray ray-2"></div>
        <div class="ray ray-3"></div>
        <div class="ray ray-4"></div>
      </div>

      <!-- Пришелец -->
      <div
        class="alien"
        ref="alien"
        :class="{ flying: gameState === 'flying', crashed: gameState === 'crashed' }"
      >
        <svg
          xmlns="http://www.w3.org/2000/svg"
          xmlns:xlink="http://www.w3.org/1999/xlink"
          width="260"
          height="201"
          viewBox="0 0 260 201"
          fill="none"
        >
          <rect width="260" height="201" fill="url(#pattern0_1234_5536)" />
          <defs>
            <pattern
              id="pattern0_1234_5536"
              patternContentUnits="objectBoundingBox"
              width="1"
              height="1"
            >
              <use
                xlink:href="#image0_1234_5536"
                transform="matrix(0.000245343 0 0 0.00031736 -0.0024632 0)"
              />
            </pattern>
            <image
              id="image0_1234_5536"
              width="4096"
              height="3151"
              preserveAspectRatio="none"
              xlink:href="data:image/png;base64,"
            />
          </defs>
        </svg>
      </div>

      <!-- Неоновое свечение снизу -->
      <div class="glow-bottom"></div>
    </div>
  </div>
</template>

